import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
const e = React.createElement;
function App() {
  return (
    e('div',{className:'container c-design'},
      e('div',{className:'row'},
        e('div',{className:'col-md-6 content-console'},
          e('p',{},'Console'),
          e('textarea',{className:'textarea'},),
          e('button',{},'Clear')
          ),
        e('div',{className:'col-md-6 content-admin'},
          e('p',{},'Train')
        ),

      )
    )
  );
}

export default App;
